import './NavBar.scss';

import { NavLink } from "react-router-dom";

function NavBar() {
    return (
        <nav>
            <div>Laurie Villeton</div>
            <ul>
                <NavLink to="/" >Projects</NavLink>
                <NavLink to="/" >About</NavLink>
                <NavLink to="/" >Contact</NavLink>
            </ul>
        </nav>
    );
}

export default NavBar;
